contracts/Manufacturer.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Manufacturer{
    // string UserId;
    // string Password;
    // string CompanyName;
    uint public serialnumber;
    uint dnaDigits = 16;
    uint dnaModulus = 10 ** dnaDigits;
    Medication[] public medd;
    uint[] public Sn;
    uint256 CreationTime;
    uint256  dispatchedtimeByManufacturer;
    string public  checker;
    mapping(uint => string)public   IpfsRevision;
    event Mdispatch(string message);

    enum SupplyChainState{Created,DispatchedByManufacturer,VerifiedBySupplier,DispatchedBySupplier,VerifiedByPharmacist}

    struct Medication{

        SupplyChainState state;
        string batchnumber;
        string manufacturer;
        string  name;
        uint256 Manufacturing_date;
        uint256 Expiring_date;
        bytes32  ipfsCid;

    }

    mapping(uint  => Medication)public medications;

    event product(string message, uint  _sn);


    function  addprouct( string memory _name, string memory _batchno, string memory _manufacturer, SupplyChainState  _state, uint256 _Manufacturing_date,uint256 _Expiring_date )public virtual {
         
        CreationTime = block.timestamp;
         serialnumber = uint(keccak256(abi.encodePacked(_name, _batchno, _manufacturer)));
         serialnumber %= dnaModulus;
        //  bytes32 cidBytes = bytes32(bytes(_cid));
        

         medications[serialnumber].batchnumber= _batchno;
         medications[ serialnumber].name = _name;
         medications[serialnumber].manufacturer = _manufacturer;
         medications[serialnumber].Manufacturing_date= _Manufacturing_date;
         medications[serialnumber].Expiring_date= _Expiring_date;
         medications[serialnumber].state =  _state;
        //  medications[serialnumber].ipfsCid =  cidBytes;
         
    
         Sn.push(serialnumber);
         emit product("serial number of the medication", serialnumber);
         

    }


     function Serialnumbers()public view returns(uint)
     {
         return serialnumber;
     }


    

    function  Medicine_mapper_first(string memory  _CID11) public {

         IpfsRevision[serialnumber] = _CID11;


     }

   

    function Mandispatch(uint _serialnumber,string memory  _CID12)public {
        require( medications[_serialnumber].state == SupplyChainState.Created, "medication is not yet upload in chain");

       dispatchedtimeByManufacturer = block.timestamp;
        medications[_serialnumber].state= SupplyChainState.DispatchedByManufacturer;
        IpfsRevision[_serialnumber] = _CID12;//_Revision12
        emit Mdispatch("Dispatching complete successfully");
    }
  
}

contracts/pharmacist.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Manufacturer.sol";
import "./supplier.sol";

contract Pharmacist is Manufacturer, Supplier {
    string PharmacistName;
    string PUserId;
    string PPassword;
    string public mssg;
    uint256 public recievedTimeByPharmacist;
    uint256 public dispatchedTimeByPharmacist;
    event verification(string message);
    event Pdispatch(string message);
  

  string revision31;
  string revision32;


function Pverify(uint _serialnumber,string memory revision31)public  
    {   
         require( medications[_serialnumber].state == SupplyChainState.DispatchedBySupplier, "medication is not yet dispatched from Supplier");
         require(keccak256(abi.encodePacked(IpfsRevision[serialnumber])) !=0);
         medications[_serialnumber].state = SupplyChainState.VerifiedByPharmacist;

        IpfsRevision[_serialnumber] = revision31;

        dispatchedTimeByPharmacist = block.timestamp;
        emit verification("vrerification Complete");
 

    }
          
       
            
}

contracts/Public.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Manufacturer.sol";
import "./supplier.sol";
import "./pharmacist.sol";


contract Public is Manufacturer, Supplier, Pharmacist  {

event Pubverification(string message);
   




    function History(uint _serialnumber)public view returns(Medication memory,string memory,uint256, uint256, uint256)
    {
          require( medications[_serialnumber].state == SupplyChainState.VerifiedByPharmacist, "medication is not yet Verified from Pharmacist");
        require(keccak256(abi.encodePacked(IpfsRevision[serialnumber])) !=0);        
        return (medications[_serialnumber],IpfsRevision[serialnumber],  dispatchedtimeByManufacturer, dispatchedtimeBySupplier, dispatchedTimeByPharmacist);
    }
    

}

contracts/supplier.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Manufacturer.sol";

contract Supplier is Manufacturer {


uint256 public recievedtimeBySupplier;
uint256 public dispatchedtimeBySupplier;
event Status(string message);

string revision22;
//event Sdispatch(string message);


    function verify(uint _serialnumber,string memory revision21)public  
    {   
         require( medications[_serialnumber].state == SupplyChainState.DispatchedByManufacturer, "medication is not dispatched yet from manufacturer");
         //require(keccak256(abi.encodePacked(IpfsRevision[serialnumber])) == (keccak256(abi.encodePacked(checker))),"product is counterfeit");
        require(keccak256(abi.encodePacked(IpfsRevision[serialnumber])) !=0);
         medications[_serialnumber].state = SupplyChainState.VerifiedBySupplier;

      
        IpfsRevision[_serialnumber] = revision21;
        emit Status("verfication Complete");


    }
    
    

    function Supdispatch(uint _serialnumber,string memory revision22)public {
         require( medications[_serialnumber].state == SupplyChainState.VerifiedBySupplier, "medication is not yet upload in chain");
       dispatchedtimeBySupplier = block.timestamp;
        medications[_serialnumber].state= SupplyChainState.DispatchedBySupplier;

        IpfsRevision[_serialnumber] = revision22;

         emit Status("Dispatching complete successfully");
    }


    



    }

